@ncastlez *dead dog and empty can of pop on the ground*

"And he drank the blackest pop...the devil's pop..."

"Oh stop being so damn dramatic, Loomis. It's just Dr. Pepper."

@angelwhoheals &gt;stop it, but that’s kinda my whole point. You guys kept one fight going through all of history. 

I had to get used to everyone dying if we didn’t hash it out fast. There’s no high ground about it; just practice. 

And sure, all the alters are different and one of mine still &gt;

@DeadlyDailey @b_pitt8 @TheNickGeller @JaredSawyerJr @DerrekLL The actual "truth" may never be known. I have seen people of color being arrested absolutely NOT resisting arrest and yet you will hear the cops yelling - "stop resisting, stop resisting" as the men &amp; women are thrown to the ground &amp; beaten, kicked, choked.
Reports = BS
So...

@mcmxl22 1) stop exploiting your uncles navy service for likes, retweets and sympathy 

2) your uncle didn’t give his life for a flag; that’s ignorant of you to say 

3) last I checked the navy is utilized for of a transportation organization not necessarily ground troops

@TheDemonOfSong @RenewalSavage @SonOfTaekkyeon - body away, but that wouldn’t stop him.

This would enrage him.....fill him with massive anger like a Wolverine gone wild. The scythe of Death was on the ground, awaiting for its master to return.

Having his feet return, his eyes twitch, the area around them rumbled to fill-

@VincentWright It is really sad that we now settle altercations with guns which result in murder.
To those who claim guns don’t kill,”I say”, without a gun, we might have just had a fistfight. 
Stop “STAND YOUR GROUND” This is a license to murder.

@ElysianVirtuous His laughing slowly comes to a stop. He proceeds to press a random button and the windows of brobot open releaving that Brobot never left Hyrule to begin with. Hyrule was perfectly safe.

"Oh-ho! You SERIOUSLY crack me up."

He opened the door and jumped to the ground.

